import React from "react";
const http = require("http")
const url = require('url')
const qs = require('querystring')

const Home = (props) => {
    const user = (qs.parse(url.parse(window.location.href).query)['id'])

    const redirectToHome = () => {
        history.push('/');
    }

    return (
        <div className="base-container" >
            <div className="header">Bienvenue retour, {user} !</div>
            <div className="header">Login</div>
            <div className="content">
              <div className="image">
                <img src={loginImg} alt="accueil login"/>
              </div>
              <div className="form">
                <div className="form-group">
                  <label htmlFor="username">Username</label>
                  <input type="text" name="username" placeholder="username" ref={register({ required: true, maxLength: 30 })}/>
                </div>
                <div className="form-group">
                  <label htmlFor="password">Password</label>
                  <input type="password" name="password" placeholder="password" ref={register({ required: true, maxLength: 30 })} />
                </div>
              </div>
            </div>
            <div className="footer">
              <button type="submit" className="btn">
                Login
              </button>
            </div>
            <div className="log-out-button">
                <span className="register-message" onClick={() => logOut()}>Log Out</span>
            </div>
        </div>
    )
}


export default Home;
